using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
//
namespace PeakSWC.RemoteWebView
{
    public static class RestartPage
    {
        public static string Html(string guid, string processName, string hostName)
        {
            string restart = string.IsNullOrEmpty(processName) || string.IsNullOrEmpty(hostName) ? "Restarting" : $"Restarting<b>{ processName}</ b > on host<b>{ hostName}</b>";
            string html = $@"
<!DOCTYPE html>
<html lang='en' style='height: 100%;' >
<head>
  <title>Restarting...</title>
  <meta charset='utf-8'>
  <meta name='viewport' content='width=device-width, initial-scale=1'>
  <script type='text/javascript'>
      var xmlHttp = new XMLHttpRequest();
      xmlHttp.onreadystatechange = function () {{
        if (xmlHttp.readyState == 4 && xmlHttp.status == 200) {{ 
          window.location.assign('/app/{guid}');       
        }} else  if (xmlHttp.readyState == 4 && xmlHttp.status == 400){{
            document.getElementById('restarting').innerHTML = xmlHttp.responseText;
          
        }}
      }};
      xmlHttp.open('GET', '/wait/{guid}', true);
      xmlHttp.send(null);
  </script>
</head>
<body style='margin:0; width:100%; height:100%;background-color:#f1f2f3'> 

<div id='restarting' style='vertical-align: middle; margin:20px; height:100%;text-align: center;' >
  <h1 >{restart} </h1>
<br/>
  <img  style='height:200px;display:block; margin-left: auto;margin-right: auto;' src='data:image/gif;base64,'/>                
</div>
</body>
</html>

";
            return html;
        }
       
    }
}
